def seq_search(a, key):
    i = 0
    cnt = 0
    while True :
        cnt += 1
        if i == len(a):
            return (-1, cnt)
        cnt += 1
        if a[i] == key :
            return (i, cnt)
        i += 1

def seq_search_sentinel(b, key) :
    a = b.copy()
    a.append(key)

    i = 0
    cnt = 0
    while True :
        cnt += 1
        if a[i] == key :
            break
        i += 1

    return(-1, cnt) if i == len(b) else (i, cnt)

